Vue.use(VueRouter)
const routes = [
    {
        path: "/",
        component: () => import("../views/app"), //webpackChunkName app
        redirect: "/app/box",
        children: [
            {
                path: "/app",
                component: () => import("../views/app/caisses"),
                children: [
                    {
                        path: "box",
                        component: () => import("../views/app/caisses/box")
                    }]
            }
            ]

    },
    {
        path: "/",
        component: () => import("../views/app"), //webpackChunkName app
        //redirect: "/app/list/visit",
        children: [
            {
                path: "/app",
                component: () => import("../views/app/visit"),
                children: [
                    {
                        path: "list/visit",
                        component: () => import("../views/app/visit/list")
                    }]
            }
        ]

    },
    /*{
        path: "/auth",
        component: () => import("../views/app/sessions"),
        //redirect: "/app/sessions/signIn",
        children: [
            {
                path: "signIn",
                component: () => import("../views/app/sessions/signIn")
            },

        ]
    },*/
]

const router = new VueRouter({
  routes
})


